webpackJsonp([0x81b8806e4260],{1110:function(A,e){A.exports={pathContext:{group:[{node:{id:"2be0a19b-18e4-4ca3-9f85-c1c12e2ec81f",title:"Intentional Home Improvements",link:null,body:{value:"<p>New Year's resolution time!</p>\r\n<p>Things felt a little different heading into 2019. I usually have a pretty good handle on what I want to accomplish in the upcoming year, along with a formal resolution. But this year, nothing. Initially that seemed terrifying, but the more I think about it, that openness and lack of expectation is an exciting resolution in and of itself.</p>\r\n<p>Standing in my now <em>mostly</em> finished kitchen I also came up with another late breaking resolution. 2019 is going to be the year of intentional home improvements. Rather than letting a flood force me into it, I'm going to try to proactively decorate, improve and declutter. It is pleasantly (mostly) non-technical, and I can tackle it in tiny chunks throughout the year.</p>\r\n<p>Wishing everyone a happy and productive 2019 full of dry kitchens.</p> "},relationships:{image:{localFile:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.3325545171339563,src:"/static/bc4109a22f50873da49408b523d0a915-ee8d7cc9338c16ed2c4b9bc8817e39b9-42807.jpg",srcSet:"/static/bc4109a22f50873da49408b523d0a915-ee8d7cc9338c16ed2c4b9bc8817e39b9-960f9.jpg 313w,\n/static/bc4109a22f50873da49408b523d0a915-ee8d7cc9338c16ed2c4b9bc8817e39b9-c36f2.jpg 625w,\n/static/bc4109a22f50873da49408b523d0a915-ee8d7cc9338c16ed2c4b9bc8817e39b9-42807.jpg 1250w,\n/static/bc4109a22f50873da49408b523d0a915-ee8d7cc9338c16ed2c4b9bc8817e39b9-dbc5e.jpg 1875w,\n/static/bc4109a22f50873da49408b523d0a915-ee8d7cc9338c16ed2c4b9bc8817e39b9-6e234.jpg 2500w,\n/static/bc4109a22f50873da49408b523d0a915-ee8d7cc9338c16ed2c4b9bc8817e39b9-98489.jpg 3422w",sizes:"(max-width: 1250px) 100vw, 1250px"}}}}},fields:{slug:"/post/intentional-home-improvements/"},post_type:"post",created:1546524528}},{node:{id:"01372c17-fb3c-4003-9377-0d94ff8e1859",title:"Happy Holidays",link:null,body:{value:"<p>I'm enjoying my traditional holiday illness this year. Without fail, once reach holiday break my defenses shut down and I catch a cold (or worse.) I'm thinking next year I'm going to take the week before Christmas off and just live in one of those plastic bubbles.</p>\r\n<p>Wishing everyone a happy and healthy holiday season.</p>"},relationships:{image:{localFile:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:.7226378498198948,src:"/static/b052a144cb5a7e30624736be2995ff7e-1c8cbeb3e4b2d50cf094ccb416d3e79d-42807.jpg",srcSet:"/static/b052a144cb5a7e30624736be2995ff7e-1c8cbeb3e4b2d50cf094ccb416d3e79d-960f9.jpg 313w,\n/static/b052a144cb5a7e30624736be2995ff7e-1c8cbeb3e4b2d50cf094ccb416d3e79d-c36f2.jpg 625w,\n/static/b052a144cb5a7e30624736be2995ff7e-1c8cbeb3e4b2d50cf094ccb416d3e79d-42807.jpg 1250w,\n/static/b052a144cb5a7e30624736be2995ff7e-1c8cbeb3e4b2d50cf094ccb416d3e79d-dbc5e.jpg 1875w,\n/static/b052a144cb5a7e30624736be2995ff7e-1c8cbeb3e4b2d50cf094ccb416d3e79d-6e234.jpg 2500w,\n/static/b052a144cb5a7e30624736be2995ff7e-1c8cbeb3e4b2d50cf094ccb416d3e79d-19574.jpg 2608w",sizes:"(max-width: 1250px) 100vw, 1250px"}}}}},fields:{slug:"/post/happy-holidays/"},post_type:"post",created:1545665583}},{node:{id:"3bfb027d-d913-4bad-830b-bde82f4bc1ea",title:"Flip Grip Mini Review",link:null,body:{value:'<p>\'Tis the season for all of the random Nintendo Switch related Kickstarter projects I backed throughout the year to show up in advance of the holidays.</p>\r\n<p>The <a href="https://www.kickstarter.com/projects/fangamer/flip-grip">Flip Grip</a> is a simple, but extremely well designed piece of plastic that allows you to play Switch in vertical mode. Didn\'t know that vertical mode was a thing? A small subset of often retro games support it. To try out the grip I picked up <a href="https://www.nintendo.com/games/detail/arcade-archives-donkey-kong-switch">Arcade Archives: Donkey Kong</a>, <a href="https://www.nintendo.com/games/detail/namco-museum-switch">Namco Museum</a>, and <a href="https://www.nintendo.com/games/detail/pinball-fx3-switch">Pinball FX3</a>. All told, I spent much more on games than the $12 that the grip costs.</p>\r\n<p>Overall, it works extremely well for the games that support vertical mode. It isn\'t something that I\'ll use that often, but I love having yet another configuration of this versatile device. Fingers crossed that a version of Ms. Pac-Man that supports vertical mode is released at some point.</p>  '},relationships:{image:{localFile:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.0769230769230769,src:"/static/44f040f8156059abc476919c742536e9-bf6401f0813d015bfd98379261b3de56-42807.jpg",srcSet:"/static/44f040f8156059abc476919c742536e9-bf6401f0813d015bfd98379261b3de56-960f9.jpg 313w,\n/static/44f040f8156059abc476919c742536e9-bf6401f0813d015bfd98379261b3de56-c36f2.jpg 625w,\n/static/44f040f8156059abc476919c742536e9-bf6401f0813d015bfd98379261b3de56-42807.jpg 1250w,\n/static/44f040f8156059abc476919c742536e9-bf6401f0813d015bfd98379261b3de56-dbc5e.jpg 1875w,\n/static/44f040f8156059abc476919c742536e9-bf6401f0813d015bfd98379261b3de56-6e234.jpg 2500w,\n/static/44f040f8156059abc476919c742536e9-bf6401f0813d015bfd98379261b3de56-a7d90.jpg 3024w",sizes:"(max-width: 1250px) 100vw, 1250px"}}}}},fields:{slug:"/post/flip-grip-mini-review/"},post_type:"post",created:1544108145}},{node:{id:"e7f7525d-76fb-4ad7-8d88-41c9d66d19a4",title:"Talking Drupal #188 - Static Site Generation",link:"http://www.talkingdrupal.com/188",body:{value:'<p>Had a great time dropping in on the <a href="http://www.talkingdrupal.com/">Talking Drupal podcast</a> to talk about static site generation. I\'ve enjoyed talking about this topic within the Drupal community recently because it really gets people (myself included) thinking about the possibilities and challenging their perceptions of what a site can be. It has also introduced me to the interesting and difficult to describe phenomenon of people "thinking" audibly. Happens a bit on the podcast as well.</p> '},relationships:{image:null},fields:{slug:"/link/talking-drupal-188-static-site-generation/"},post_type:"link",created:1543966072}},{node:{id:"7ab273ad-4c3f-4254-a338-ccd79acd6d1a",title:"Ricky Jay's Magical Secrets",link:"https://www.newyorker.com/magazine/1993/04/05/secrets-of-the-magus",body:{value:"<blockquote>People ask me why I don’t do lectures at magic conventions, and I say, ‘Because I’m still learning.’ Meanwhile, you’ve got people who have been doing magic for ten months and they are actually out there pontificating. It’s absurd.”</blockquote>\r\n<p>I've been catching up on a lot of stuff related to sleight of hand magician Ricky Jay after he passed away last week. The quote above from a fantastic 1993 New Yorker profile kept rattling around in my head. Given that his whole career is based on deception, you can't take anything he says at face value (pun intended,) but it is wonderful to think that one of the worlds best magicians still considered himself a student.</p>\r\n<p>As someone who has done a lot of speaking this year I often feel this way. \"Why should people listen to me - I just figured this out a couple of weeks ago.\" What allows me to fight back the imposter syndrome is the fact that I believe understanding how someone learned something has a lot of value. And I think this is the case for beginners and experts alike.</p>"},relationships:{image:null},fields:{slug:"/link/ricky-jay's-magical-secrets/"},post_type:"link",created:1543327994}}],pathPrefix:"",first:!0,last:!1,index:1,pageCount:12,additionalContext:{}}}}});
